import {legacy_createStore as createStore} from 'redux';

const patientData = {
    patientName: null,
    pickupAddress: null,
    pickupTime: null,
    pickupNotes:null,
}

const driverData = [
    {
        name: "Ahmed Rafsan Raqib",
        driverID: "raf97",
        location: "2302 130th Ave NW, Coon Rapids, MN, 55448, USA",
        vehicleId: 245
      }, 
      {
        name: "Ahmed Ispahan Raqib",
        driverID: "isp05",
        location: "1282 Concordia Ave, Saint Paul, MN, 55104, USA",
        vehicleId: 500
      }, 
      {
        name: "Labiba Nayeem Khan",
        driverId: "lab200",
        location: "300 Washington Ave SE, Minneapolis, MN,55455, USA",
        vehicleId:600
      },
];

const reducer = (state=patientData, action) => {

    switch(action.type) {

        case "SETPATIENTDATA":
            return{
                ...state, 
                patientName:action.payload.id,
                pickupAddress:action.payload.patientPickupAddress,
                pickupTime:action.payload.pickupTime,
                pickupNotes:action.payload.pickupNotes
            }

        default:
            return state
    }
}

export default createStore(reducer);
